import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'investmentval'
})
export class InvestmentvalPipe implements PipeTransform {

  transform(value: number,stockquantity:number): unknown {
    return (value*stockquantity);
  }

}
